@saintjosephsartsfoundation hosted a fundraiser for @studsf and it was so cool. The Stud is the oldest queer bar in SF that finally reopened just last Saturday in SoMa. I love seeing the city bounce back, so definitely check them out on Folsom and 7th when you have the chance. This was such a fun event with drag queens, Djs, wine, and art by Julian Lennon. You can find his solo exhibition, Wake up and Dream, right here at Saint Joseph’s. You gotta check it out! 

📍 1401 Howard St, San Francisco, CA 94103
#sfinfluencer #sfblogger #art #artsociety #fundraiser #stjosephs #thestudsf

